import React from 'react';

const ColorCodedBar = ({ parameters }) => {
  return (
    <div className="color-coded-bar">
      {parameters.map((param, index) => (
        <div
          key={index}
          className="color-block"
          style={{
            backgroundColor: param.color,
            width: `${param.value}%`
          }}
        />
      ))}
    </div>
  );
};

export default ColorCodedBar;
